import logo from './logo.svg';
import { Routes, Route } from 'react-router-dom';
import './App.css';
import Layout from './components/Layout';

function App() {
  return (
    <>
      <Layout/>
      <Routes>
        <Route path='/' Component={Layout}/>
      </Routes>
    </>
  );
}

export default App;
